func addTwoNumbers(l1 *ListNode, l2 *ListNode) *ListNode {
    // 1. è¿”å›å€¼æ˜¯ä¸€ä¸ªé“¾è¡¨èŠ‚ç‚¹,æ‰€ä»¥å®šä¹‰ä¸€ä¸ªè¿”å›å€¼çš„å¤´
    result := &ListNode{Val: 0}

