package main

import (
    "fmt"
    "math"
)

func findMedianSortedArrays(nums1 []int, nums2 []int) float64 {
    m := len(nums1)
    n := len(nums2)
    if m > n {
        m, n = n, m
        nums1, nums2 = nums2, nums1
    }

    iMin := 0
    iMax := m
    for iMin  nums1[i] {
            // iéœ€è¦å¢å¤§
            iMin = i + 1
        } else if i != 0 && j != n && nums1[i-1] > nums2[j] {
            // iéœ€è¦å‡å°
            iMax = i - 1
        } else {
            // è¾¾åˆ°æ¡ä»¶ï¼Œè¾¹ç•Œå€¼åˆ—å‡ºæ¥å•ç‹¬è€ƒè™‘
            maxLeft := 0.0
            if i == 0 {
                maxLeft = float64(nums2[j-1])
            } else if j == 0 {
                maxLeft = float64(nums1[i-1])
            } else {
                maxLeft = math.Max(float64(nums1[i-1]), float64(nums2[j-1]))
            }
            if (m+n)%2 == 1 {
                // å¥‡æ•°ä¸éœ€è¦è€ƒè™‘å³åŠéƒ¨åˆ†
                return maxLeft
            }

            minRight := 0.0
            if i == m {
                minRight = float64(nums2[j])
            } else if j == n {
                minRight = float64(nums1[i])
            } else {
                minRight = math.Min(float64(nums2[j]), float64(nums1[i]))
            }
            // å¦‚æœæ˜¯å¶æ•°ç›´æ¥è¿”å›
            return (maxLeft + minRight) / 2.0
        }
    }
    return 0.0

}

func main() {
