// Parse block-level data.
// Note: this function and many that it calls assume that
// the input buffer ends with a newline.
func (p *Parser) block(data []byte) {
    // this is called recursively: enforce a maximum depth
    if p.nesting >= p.maxNesting {
        return
    }
    p.nesting++

    // parse out one block-level construct at a time
    for len(data) > 0 {
        // attributes that can be specific before a block element:
        //
        // {#id .class1 .class2 key="value"}
        if p.extensions&Attributes != 0 {
            data = p.attribute(data)
        }

        if p.extensions&Includes != 0 {
            f := p.readInclude
            path, address, consumed := p.isInclude(data)
            if consumed == 0 {
                path, address, consumed = p.isCodeInclude(data)
                f = p.readCodeInclude
            }
            if consumed > 0 {
                included := f(p.includeStack.Last(), path, address)
                p.includeStack.Push(path)
                p.block(included)
                p.includeStack.Pop()
                data = data[consumed:]
                continue
            }
        }

        // user supplied parser function
        if p.Opts.ParserHook != nil {
            node, blockdata, consumed := p.Opts.ParserHook(data)
            if consumed > 0 {
                data = data[consumed:]

                if node != nil {
                    p.addBlock(node)
                    if blockdata != nil {
                        p.block(blockdata)
                        p.finalize(node)
                    }
                }
                continue
            }
        }

        // prefixed heading:
        //
        // # Heading 1
        // ## Heading 2
        // ...
        // ###### Heading 6
        if p.isPrefixHeading(data) {
            data = data[p.prefixHeading(data):]
            continue
        }

        // prefixed special heading:
        // (there are no levels.)
        //
        // .# Abstract
        if p.isPrefixSpecialHeading(data) {
            data = data[p.prefixSpecialHeading(data):]
            continue
        }

        // block of preformatted HTML:
        //
        // 
        //     ...
        // 
        if data[0] == ' 0 {
                data = data[i:]
                continue
            }
        }

        // title block
        //
        // % stuff
        // % more stuff
        // % even more stuff
        if p.extensions&Titleblock != 0 {
            if data[0] == '%' {
                if i := p.titleBlock(data, true); i > 0 {
                    data = data[i:]
                    continue
                }
            }
        }

        // blank lines.  note: returns the # of bytes to skip
        if i := p.isEmpty(data); i > 0 {
            data = data[i:]
            continue
        }

        // indented code block:
        //
        //     func max(a, b int) int {
        //         if a > b {
        //             return a
        //         }
        //         return b
        //      }
        if p.codePrefix(data) > 0 {
            data = data[p.code(data):]
            continue
        }

        // fenced code block:
        //
        // ``` go
        // func fact(n int) int {
        //     if n 
    if p.extensions&FencedCode != 0 {
        if i := p.fencedCodeBlock(data, true); i > 0 {
            data = data[i:]
            continue
        }
    }

    // horizontal rule:
    //
    // ------
    // or
    // ******
    // or
    // ______
    if p.isHRule(data) {
        p.addBlock(&ast.HorizontalRule{})
        i := skipUntilChar(data, 0, '\n')
        data = data[i:]
        continue
    }

    // block quote:
    //
    // > A big quote I found somewhere
    // > on the web
    if p.quotePrefix(data) > 0 {
        data = data[p.quote(data):]
        continue
    }

    // aside:
    //
    // A> The proof is too large to fit
    // A> in the margin.
    if p.extensions&Mmark != 0 {
        if p.asidePrefix(data) > 0 {
            data = data[p.aside(data):]
            continue
        }
    }

    // figure block:
    //
    // !---
    // ![Alt Text](img.jpg "This is an image")
    // ![Alt Text](img2.jpg "This is a second image")
    // !---
    if p.extensions&Mmark != 0 {
        if i := p.figureBlock(data, true); i > 0 {
            data = data[i:]
            continue
        }
    }

    // table:
    //
    // Name  | Age | Phone
    // ------|-----|---------
    // Bob   | 31  | 555-1234
    // Alice | 27  | 555-4321
    if p.extensions&Tables != 0 {
        if i := p.table(data); i > 0 {
            data = data[i:]
            continue
        }
    }

    // an itemized/unordered list:
    //
    // * Item 1
    // * Item 2
    //
    // also works with + or -
    if p.uliPrefix(data) > 0 {
        data = data[p.list(data, 0, 0):]
        continue
    }

    // a numbered/ordered list:
    //
    // 1. Item 1
    // 2. Item 2
    if i := p.oliPrefix(data); i > 0 {
        start := 0
        if i > 2 && p.extensions&OrderedListStart != 0 {
            s := string(data[:i-2])
            start, _ = strconv.Atoi(s)
            if start == 1 {
                start = 0
            }
        }
        data = data[p.list(data, ast.ListTypeOrdered, start):]
        continue
    }

    // definition lists:
    //
    // Term 1
    // :   Definition a
    // :   Definition b
    //
    // Term 2
    // :   Definition c
    if p.extensions&DefinitionLists != 0 {
        if p.dliPrefix(data) > 0 {
            data = data[p.list(data, ast.ListTypeDefinition, 0):]
            continue
        }
    }

    if p.extensions&MathJax != 0 {
        if i := p.blockMath(data); i > 0 {
            data = data[i:]
            continue
        }
    }

    // document matters:
    //
    // {frontmatter}/{mainmatter}/{backmatter}
    if p.extensions&Mmark != 0 {
        if i := p.documentMatter(data); i > 0 {
            data = data[i:]
            continue
        }
    }

    // anything else must look like a normal paragraph
    // note: this finds underlined headings, too
    idx := p.paragraph(data)
    data = data[idx:]
}

p.nesting--
}



